import React from "react";

import classes from "./Movie.module.css";

const Movie = (props) => {
  return (
    <li className={classes.movie}>
      <h2>{props.title}</h2>
      <img src={props.backdrop_path} alt="test" />
      <p>{props.overviews}</p>
    </li>
  );
};

export default Movie;
